import React, { Component, Fragment } from 'react';
import { Helmet } from "react-helmet";

class Play extends Component {
    constructor (props) {
        super (props);
        this.state = {
            counter: 0
        };
    }

    increaseCount = () => {
        this.setState({
            counter: 5
        });
    };

    render() {
        return (
            <Fragment>
                <Helmet><title>Programming assignment - Quiz Page</title></Helmet>
                <div className="quastions">

                </div>
            </Fragment>
        );
    }
}

export default Play;
